function renderJobTable(doc, c){
    let node = document.createElement('tr');
    let employer = document.createElement('td');
    let category= document.createElement('td');
    let required = document.createElement('td');
    let status = document.createElement('td');
    let deadline = document.createElement('td');
    let about = document.createElement('td');
    let presstoapply = document.createElement('td');
    let applyButton = document.createElement('button');
    let pdfButton = document.createElement('button');

    applyButton.setAttribute("id",c);
    pdfButton.setAttribute("id",c+1);

    var jobid = doc.id;
    applyButton.setAttribute("name", jobid);
    applyButton.setAttribute("onClick","clickedButton(this.id, this.name)");

    
    pdfButton.setAttribute("name", jobid);
    pdfButton.setAttribute("onClick","pdfDownload(this.id, this.name)");

    node.setAttribute('doc-id',doc.id);
    employer.textContent = doc.data().employer;
    category.textContent = doc.data().category;
    required.textContent = doc.data().skills;
    status.textContent = doc.data().jobstatus;
    deadline.textContent = doc.data().deadline;
    about.textContent = doc.data().about;
    var texts = document.createTextNode("Apply");
    applyButton.appendChild(texts);
    
    var downloadtext = document.createTextNode("PDF");
    pdfButton.appendChild(downloadtext);
    
    node.append(category);
    node.append(employer);
    node.append(required);  
    node.append(status);
    node.append(deadline);
    node.append(about);
    node.append(applyButton);
    node.append(pdfButton);
    jobTable.append(node);
}   


function clickedButton(id, jobid){

    auth.onAuthStateChanged(user => {
        if (user) {
            const docRef = firestore.collection('Users');
            docRef.doc(user.uid).get().then(function(doc) {
                var userid = doc.id;
                firestore.collection('Applicants').where('user_id','==',userid).where('job_id','==',jobid).get().then((snapshot)=>{
                    if(snapshot.docs.length > 0){
                        alert("You are already applied for this job");
                    }
                    else{
                        firestore.collection('Applicants').add({
                            user_id: auth.currentUser.uid,
                            job_id: jobid 
                        });
                        alert("Applied for job");
                        var template_params = {
                            "user_email": user.email,
                            "reply_to": "noreply",
                            "to_name": user.displayName
                         }
                         var service_id = "default_service";
                         var template_id = "template_FNuLCybl";
                     
                        
                         emailjs.send(service_id, template_id, template_params)
                        .then(function(response) {
                        console.log('SUCCESS!', response.status, response.text);
                        }, function(error) {
                        console.log('FAILED...', error);
                        });
                    }
                });
            });
        }else{
            alert("You must be logged in to apply");
        }
    });
}


function pdfDownload(id, jobid){
    
    let pdfFile = new jsPDF();
    firestore.collection('Jobs/').doc(jobid).get().then((snapshot)=>{

            /*DO NOT EDIT THIS LINK */
            let imgData='data:image/png;base64,';
            pdfFile.addImage(imgData, 'JPEG', 45, 3, 120, 0) 
            pdfFile.text('About Job:'   +snapshot.data().about,    10, 60);
            pdfFile.text('Age:'         +snapshot.data().age,      10, 70);
            pdfFile.text('Category:'    +snapshot.data().category, 10, 80);
            pdfFile.text('Employer:'    +snapshot.data().employer, 10, 90);
            pdfFile.text('Gender: '     +snapshot.data().gender,   10, 100);
            pdfFile.text('Job Status:'  +snapshot.data().jobstatus,10, 110);
            pdfFile.text('Job Level:'   +snapshot.data().levels,   10, 120);
            pdfFile.text('Job location:'+snapshot.data().location, 10, 130);
            pdfFile.text('Job Opened: ' +snapshot.data().opened,   10, 140);
            pdfFile.text('Job Closing: '+snapshot.data().deadline, 10, 150);
            pdfFile.text('Salary: '     +snapshot.data().salary,   10, 160);
            pdfFile.text('Job Skills: '  +snapshot.data().skills,   10, 170);
            pdfFile.save(snapshot.data().employer+snapshot.data().jobstatus+'.pdf');


           // alert("You are already applied for this job");
            //console.log(snapshot.employerID);

    });

}



